import React from 'react';

const EmojiImage = ({ emojis }) => {
	return (
		<div>
			{emojis.map((row, index) => {
				return (
					<div key={index}>
						{row.map((emoji, index) => {
							return <p key={index}>{emoji}</p>;
						})}
					</div>
				);
			})}
		</div>
	);
};

export default EmojiImage;
